    )
    .then((res) => {
      dispatch(createMessage({ addBiosample: 'Biosamples Added' }));
      dispatch({
        type: POST_BIOSAMPLE,
        payload: res.data,
      });
    })
    .catch((err) => dispatch(returnErrors(err.response.data, err.response.status)));
};


export const addAnalysis = (project) => (dispatch, getState) => {
  axios
    .post(
      `${process.env.REACT_APP_API_URL}/api/analysis/`,
      project,
      tokenHeader(getState)
    )
    .then((res) => {
      dispatch(createMessage({ addAnalysis: 'Analysis Added' }));
      dispatch({
        type: ADD_ANALYSIS,
        payload: res.data,
      });
    })
    .catch((err) => dispatch(returnErrors(err.response.data, err.response.status)));
};
